All that glitters 

Beautiful things attract all of us. We all want to possess that which is beautiful .. whether it‚Äôs jewellery or fast cars or a big house or a title or a position .. or something else.
We want all these things because of what they symbolise .. for some it‚Äôs security .. for some it‚Äôs confidence .. courage .. status .. we all want to paint a pretty picture of ourselves, because you feel this will make you more attractive.

The card today wants you to stop wanting to wear this mask .. in fat you are being asked to recognise people .. to see beyond the mask that they are wearing.

Now is the time to look past the surface, beyond the mask, to the essence of a person. Who that person is, not what he or she has or can give you, is important. See beyond the glitter and look for the inner glow. Use the eyes in your heart. Let go of artifice and let what is authentic shine.

Stop chasing after things that you feel will elevate you .. you will delete your energy by doing this .. don‚Äôt give into jealousy .. what another has achieved may not truly be the success that you seek .. so refrain from comparing yourself to them. You see only the surface right now, only the sparkle. 
Be assured that you will experience your own shining moment if you stick to what you know. All that glitters may not be gold for you!
